import React from "react";
import Card from "./Card";

const CardList = ({robots}) => {
    const card_commponent = robots.map((user, i) => {
        return(
            <Card id={robots[i].id} name={robots[i].name} email={robots[i].email}/>
        )
    })
    return(
        <div>
            card_commponent
        </div>
    )
}
export default CardList;
